// ==UserScript==
// @name         Disguise website as ChatGPT
// @version      0.2
// @namespace    namespace
// @description  Change website's title and icon to ChatGPT's, as a disguise. By default, this applies to discord.com. Add as many @match lines as you want.
// @match        https://discord.com/*
// @match        https://another-website.com/*
// @icon         https://www.google.com/s2/favicons?domain=chat.openai.com
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/459637/Disguise%20website%20as%20ChatGPT.user.js
// @updateURL https://update.greasyfork.org/scripts/459637/Disguise%20website%20as%20ChatGPT.meta.js
// ==/UserScript==


window.addEventListener('load', function() {

function chat(){
    document.title = "New chat";
    var icon = document.querySelector('link[rel~="icon"]');
    var copy = icon.cloneNode(!0);
    copy.href = "data:image/png;base64,";
    icon.parentNode.removeChild(icon);
    document.head.appendChild(copy);
}

setInterval(chat, 333);

}, false);